{% block title %}Hello ProduitController!{% endblock %}

{% block body %}
<!DOCTYPE html>
<html lang=\"fr\">
<head>
    <meta charset=\"UTF-8\">
    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">
    <title>Liste de produits</title>
</head>
<body>

<table>
    <thead>
        <tr>
            <th>ID</th>
            <th>Nom</th>
            <th>Quantité</th>
            <th>Prix</th>
            <th>Date de création</th>
            <th>Caractéristiques</th>
            <th>Description</th>
            <th>Image</th>
        </tr>
    </thead>
    <tbody>
        {% for produit in produits %}
            <tr>
                <td>{{ produit.id }}</td>
                <td>{{ produit.nom }}</td>
                <td>{{ produit.quantite }}</td>
                <td>{{ produit.prix }}</td>
                <td>{{ produit.createAt|date('Y-m-d') }}</td>
                <td>{{ produit.caracterique }}</td>
                <td>{{ produit.description }}</td>
                <td>
                    {% if produit.image %}
                        <img src=\"{{ asset('uploads/images/' ~ produit.image) }}\" alt=\"{{ produit.nom }}\" style=\"max-width: 100px;\">
                    {% endif %}
                </td>
            </tr>
        {% endfor %}
    </tbody>
</table>
</body>
</html>
{% endblock %}", "produit/list.html.twig", "E:\\site_ecole\\templates\\produit\\list.html.twig");
